    description: send tcp
    parameters:
      - name: ip
        description: one number
        multiline: false
        required: true
        example: 192.168.1.1
        schema:
          type: string
      - name: speed
        description: 1000 packages per s
        multiline: false
        required: true
        schema:
          type: string
        example: 1000
      - name: start_time
        description: start time
        multiline: false
        required: false
        schema:
          type: string
        example: 2018-08-11 13:41:11
      - name: end_time
        description: end time
        multiline: false
        required: false
        schema:
          type: string
        example: 2018-08-11 13:41:11
      - name: log_path
        description: log path
        multiline: false
        required: false
        schema:
          type: string
